import React from "react";
import "./App.css";
import FormLogin from "./components/FormLogin";
import Header from "./components/inc/header.jsx";

function App() {
  return (
    <div className="App">
      <header className="Header">
        <Header /> 
      </header>

      <div className="FormLogin">
        <FormLogin />
      </div>
    </div>
  );
}

export default App;
